import React, { useState } from 'react';
import Services from '../Services/Services';

const Service = () => {
    const serviceData = [
        {
            id : 1,
            image: 'https://ibb.co/zmPM7r6',
            name: 'Web Design',
            detail: 'Lorem ipsum dolor sit amet consectetur adipisicing elit. Quasi, provident'
        },
        {
            id : 2,
            image:'https://ibb.co/W56R4Nn',
            name: 'Graphic Design',
            detail: 'Lorem ipsum dolor sit amet consectetur adipisicing elit. Quasi, provident'
        },
        {
            id : 3,
            image:'https://ibb.co/4f2R32K',
            name: 'Web Development',
            detail: 'Lorem ipsum dolor sit amet consectetur adipisicing elit. Quasi, provident'
        }
    ]
    return (
        <section className="services-container mt-5">
        <div className="text-center">
            <h5 style= {{color:'#1CC7C1'}}>OUR SERVICES</h5>
            <h2  style= {{color:'#3A4256'}}>Services We Provide</h2>
        </div>
        <div className="d-flex justify-content-center ">
        <div className="w-75 row mt-5 pt-5">
            {
                 serviceData.map( (data, index) => <Services data={data} key={index}></Services>)
            }

        </div>
    </div>
    </section>
       
    );
};

export default Service;
